import React from 'react'
import { NavLink } from 'react-router-dom'
import web from '../src/images/img1.png'
import Common from './Common'

const Home = () => {
  return (
    <>
        <Common
            name='Welcome to About Page !'
            imgsrc = {web}
            visit
        />
    </>
  )
}

export default Home
